import { Marker } from 'google-maps-react';

class CustomMarker extends Marker {
    render() {
        return (
            <div style={{
                color: 'white', 
                background: 'grey',
                padding: '15px 10px',
                display: 'inline-flex',
                textAlign: 'center',
                alignItems: 'center',
                justifyContent: 'center',
                borderRadius: '100%',
                transform: 'translate(-50%, -50%)'
            }}>
                asdf
            </div>
        )
    }
}

export default CustomMarker;
